def maem(rpath):
    #mean absolut error macroaveraging
    
    df=pd.read_csv(rpath,sep=",",skiprows=0,header=0)
    
    cases=set(df.iloc[:,2].tolist())

    mae=[]
    
    for i in cases:
        subdf = df[(df.iloc[:,2] == i)]
        mae.append(np.average(abs(subdf.iloc[:,1]-subdf.iloc[:,2])))
    
    maem=mean(mae)
    return maem

